            </Nav>
          </div>

          <Tab.Content>
            <Tab.Pane eventKey="first">1</Tab.Pane>
            <Tab.Pane eventKey="Overview">Overview</Tab.Pane>
            <Tab.Pane eventKey="Team">Team</Tab.Pane>
            <Tab.Pane eventKey="Chats">Chats</Tab.Pane>
            <Tab.Pane eventKey="Meetings">
              <Meetings />
            </Tab.Pane>
          </Tab.Content>
        </Tab.Container>
      </div>
    </>
  );
};

const Meetings = () => {
  return (
    <>
      <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3 ">
